import { setFileScope, endFileScope } from "@vanilla-extract/css/fileScope";
import { style } from "@vanilla-extract/css";
setFileScope("src/lib/components/ButtonIcon/ButtonIcon.css.ts?used", "braid-design-system");
const button = style({
  ":hover": {
    zIndex: 1
  },
  selectors: {
    [`&::-moz-focus-inner`]: {
      border: 0
    }
  }
}, "button");
endFileScope();
export {
  button
};
